import React from 'react';
import {Button} from "react-bootstrap";
import {Link} from "react-router-dom";

// image
import Car from "../../images/car.png";

// styles
import "./banner.styles.scss";

const Banner = () =>(

<div className="container-fluid">
    <div className="row">
        <div className="col-md-6 banner-image"><img src={Car} alt="First slide" /></div>
        <div className="col-md-6 d-flex  flex-column align-text-center">IS YOUR CAR DUE FOR SERVICE <span>FIND A GARAGE IN YOUR NEIGHBOURHOOD, RIGHT NOW!</span>            
         <Button className="home-btn">
            <Link to="/search">Search</Link>
         </Button></div>
    </div>
</div>
);

export default Banner;
